const initialState = {
  data: [],
  idList: [],
  status: "idle",
  error: null,
  watchList: [],
};

export const fetchLTData = createAsyncThunk("users/fetchLTData", async (id) => {
  let newdata = {};
  const snapshot = await axios.get(
    `http://tmdata.udc.local/api/life/${id}`
  )
  
  if (snapshot.status === 200){
    newdata = snapshot.data
  }
  // console.log("****Fake Fetch *************")
  // newdata = sampleData
  return newdata;
});

